import React, { Component } from 'react'
import Table from '../table'
import { url } from '../../config.js'

export default class Home extends Component {
    state = {
        data: []
    };

    componentDidMount() {
        
        fetch(url + 'attendance/getRecent/30')
            .then(response => {
                return response.json();
            })
            .then(json => {
                this.setState({
                    data: json
                })
            })
    }
    render() {
        return (
            <div style={bodyStyle}>
                   <Table data={this.state.data} onClickRow={(index) => this.props.onClickRow(this.state.data[index])} />
            </div>
        )
    }
}

